이렇게 하면 우리가 조종을 못하기땜에 스크립트를 통해 조절하도록 함
 using System.Collections;
using System.Collections.Generic;
using UnityEngine;
public class arrowController : MonoBehaviour {
private GameObject playerObj;
void Start () {
this.playerObj = GameObject.Find ("player");
}
void Update () {
transform.Translate (0, -0.1f, 0);
//5.0= 화면사이즈
if (transform.position.y < -5.0f) {
Destroy (gameObject);
}
//충돌판정 벡터2 일경우 xy만 가져온다.
//각 화살과 플레이어 간의 간격
Vector2 p1 = transform.position;
Vector2 p2 = this.playerObj.transform.position;
Vector2 dir = p1 - p2;
// d는 둘 간의 거리
float d = dir.magnitude; float r1 = 0.5f;
float r2 = 1.0f;
if (d < r1 + r2) {
Destroy(gameObject);
}
}
}
